import React from "react";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

function App() {
  return (
    <Router>
      <Route path="/" />
      <Route path="/university" />
      <Route path="/company" />
      <Route path="/project" />
    </Router>
  );
}

export default App;
